af_pattern:
	action == "edit" 
& article_namespace = 0
& user_editcount < 500
& ! ("bot" in user_groups)
&(
  (  count("†", removed_lines) > count("†", added_lines)
   & rcount("\bgest(?:orben|\.)", removed_lines) < rcount("\bgest(?:orben|\.)", added_lines)
  )|(count("†", removed_lines) < count("†", added_lines)
   & rcount("\bgest(?:orben|\.)", removed_lines) > rcount("\bgest(?:orben|\.)", added_lines)
  )|(rcount("[( ]\*", removed_lines) > rcount("[( ]\*", added_lines)
   & rcount("\bgeb(?:oren|\.)", removed_lines) < rcount("\bgeb(?:oren|\.)", added_lines)
  )|(rcount("[( ]\*", removed_lines) < rcount("[( ]\*", added_lines)
   & rcount("\bgeb(?:oren|\.)", removed_lines) > rcount("\bgeb(?:oren|\.)", added_lines)
  )
)

	ip_in_range(user_name, "217.224.192.0/18")
& action == "edit"
& (
  ( article_namespace == 0
    & ( 
        ( bc_n := count("'''", added_lines);
          bc_o := count("'''", removed_lines);
          bc_n > bc_o & (edit_delta == bc_n-bc_o | edit_delta == (bc_n-bc_o) * 3)
        ) 
        |
        ( lc_n := count("[[", added_lines);
          lc_o := count("[[", removed_lines);
          lc_n > lc_o & edit_delta == (lc_n-lc_o) * 4
        ) 
        |
        ( pat1 := "\[\[[^]|]*(Sprache|[Ll]atein)\|[^]|]+\]\]";
          c_n := rcount(pat1, added_lines);
          c_o := rcount(pat1, removed_lines);
          c_n > c_o
        )
        |
        ( pat2 := "(?:{{[a-zA-Z]+?S\||\[\[.+?\|)";
          s_n := rcount(pat2, added_lines);
          s_o := rcount(pat2, removed_lines);
          s_n > s_o
        )
      )
  )
  |
  ( article_namespace==1
    & 
    ( 
      added_lines rlike "Verlink(un)?g|verlinken|verli?nkt\s+werden|weitergel|Weiterl(tg)?\.|(k?eine|die) WL|k.*?pl.+?Name|an(zu)?klick|(z.{1,3}|das\s+)Lemma|lemmagerecht|nicht (direct|verli?nkt)|vermisse ich"
     |
      lcase(added_lines) rlike "falsche einwohner|(alte|neuere) daten"
    )
  )
  | 
  ( article_namespace==3 & ! user_name == article_text 
    & 
    lcase(added_lines) rlike "bergner|verfolger|mobbing|verlink"
  )
)

	action == "edit"
& ( article_namespace == 0
  & rcount("forbes.com/(?:profile|billionaires/list)|celebritynetworth|\[\[Quelle:|==\s*Vermögen\s*==", added_lines) > rcount("forbes.com/(?:profile|billionaires/list)|celebritynetworth|\[\[Quelle:|==\s*Vermögen\s*==", removed_lines)
  & ( (user_editcount < 4 & user_age != 0)
    | ip_in_range(user_name, "79.208.0.0/18")
  ) | (
    article_prefixedtext = "Wikipedia:Gesichtete Versionen/Anfragen"
    & ip_in_range(user_name, "79.208.0.0/18")
  )
)

	article_namespace != 8 
& !"bot" in user_groups & (
   formatting := "(Proxy-Connection: keep-alive|notranslate|myEventWatcherDiv|QuickiWiki Look Up|application/x-datavault|end_of_the_skype_highlighting|inlineAdmedialink|_clearly_component|ktg6us78hf8vdu7|xunlei_com_thunder_helper_plugin)";
  added_lines rlike formatting & (
    !removed_lines rlike formatting
  )
)

	action == "edit"
& article_namespace == 0
& !"sysop" in user_groups
& (pattern:="\[\s*([Cc]ategory|[Kk]ategorie)\:[Tt]echnik und Bewaffnung \(NVA\)\s*[\]\|]";
   rcount(pattern, added_lines) != rcount(pattern, removed_lines)
)
